    "crab-orchard-national-wildlife-refuge-narrative-report-november-december-1946",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crab Orchard
    National Wildlife Refuge outlines Refuge accomplishments from November through December
    of 1946. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, raptors, and fish- is also
    covered. The Refuge development and maintenance section discusses wildfires. The
    public relations section of the report describes Refuge visitors and Refuge participation.
    Items of interest and N-R forms are attached.",nt"license_title": "License
